        function initMap(){
          var chart;
          am4core.useTheme(am4themes_animated);
          chart = am4core.create("map", am4maps.MapChart);
          chart.zoomControl = new am4maps.ZoomControl();
          // Set map definition
          chart.geodata = am4geodata_usaLow;
          // Set projection
          chart.projection = new am4maps.projections.AlbersUsa();
          // Create map polygon series
          var polygonSeries = chart.series.push(new am4maps.MapPolygonSeries());
          //Set min/max fill color for each area
          polygonSeries.heatRules.push({
            property: "fill",
            target: polygonSeries.mapPolygons.template,
            min: chart.colors.getIndex(1).brighten(1),
            max: chart.colors.getIndex(1).brighten(-0.3)
          });
          // Make map load polygon data (state shapes and names) from GeoJSON
          polygonSeries.useGeodata = true;
          // Set heatmap values for each state
          // Add heat legend
        var heatLegend = chart.createChild(am4maps.HeatLegend);
        heatLegend.series = polygonSeries;
        heatLegend.width = am4core.percent(50);
        heatLegend.align = "center";
        heatLegend.valign = "bottom";

        polygonSeries.mapPolygons.template.events.on("over", function(ev) {
          if (!isNaN(ev.target.dataItem.value)) {
            heatLegend.valueAxis.showTooltipAt(ev.target.dataItem.value)
          }
          else {
            heatLegend.valueAxis.hideTooltip();
          }
        });

        polygonSeries.mapPolygons.template.events.on("out", function(ev) {
          heatLegend.valueAxis.hideTooltip();
        });
          // Set up custom heat map legend labels using axis ranges
          var minRange = heatLegend.valueAxis.axisRanges.create();
          minRange.value = heatLegend.minValue;
          minRange.label.text = heatLegend.minValue;
          var maxRange = heatLegend.valueAxis.axisRanges.create();
          maxRange.value = heatLegend.maxValue;
          maxRange.label.text = heatLegend.maxValue;

          // Blank out internal heat legend value axis labels
          heatLegend.valueAxis.renderer.labels.template.adapter.add("text", function(labelText) {
            return "";
          });
          var labelSeries = chart.series.push(new am4maps.MapImageSeries());
          var labelTemplate = labelSeries.mapImages.template.createChild(am4core.Label);
          labelTemplate.horizontalCenter = "middle";
          labelTemplate.verticalCenter = "middle";
          labelTemplate.fontSize = 10;
          labelTemplate.nonScaling = true;
          labelTemplate.interactionsEnabled = false;

            polygonSeries.events.on("inited", function () {
              polygonSeries.mapPolygons.each(function (polygon) {
                var label = labelSeries.mapImages.create();
                var state = polygon.dataItem.dataContext.id.split("-").pop();
                label.latitude = polygon.visualLatitude;
                label.longitude = polygon.visualLongitude;
                label.children.getIndex(0).text = state;
              });
            });

          // Configure series tooltip
          var polygonTemplate = polygonSeries.mapPolygons.template;
          polygonTemplate.tooltipText = `[bold]Total Audience[/]
          {name}: {value}`;
          polygonTemplate.nonScalingStroke = true;
          polygonTemplate.strokeWidth = 0.5;

          // Create hover state and set alternative fill color
          var hs = polygonTemplate.states.create("hover");
          hs.properties.fill = am4core.color("#3c5bdc");
          tempSetting.chart=chart;
          tempSetting.polygonSeries=polygonSeries;
        }
